import React from 'react';
import Link from 'next/link';

import Header from './components/Header';

export default function App() {
  return (
    <div>
      <Header />
      <h1>Hello World</h1>
      <p>Love is blind</p>
      <Link href="/about">
        <a title="About us">About</a>
      </Link>
    </div>
  );
}
